import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import ComidaTable from "../tables/ComidaTable"

const comidasInit=[
    {
        "id":1,
        "nombre":"Milanesa",
        "precio":"TUCULO"
    },
    {
        "id":2,
        "nombre":"Empanada",
        "precio":"TUCULO"
    },
    {
        "id":3,
        "nombre":"Tortilla",
        "precio":"TUCULO"
    }


]

function Comida(){
    
       const[comidas, setComidas]=useState(comidasInit)

       
    
    return  (
        <>
        <ComidaTable 
        data={comidas}
        />
       
        
        </>
    )
}


export default Comida;
